import Editor from "./components/Editor";

export default function App() {
  const [input, setInput] = useState("");

  return (
    <>
      <div className="pane top-pane">
        <Editor
          language="sql"
          displayName="SQL"
          value={input}
          onChange={setInput}
        />
      </div>
    </>
  );
}
